import React from 'react';
import { useAuth } from './AuthContext';

const Dashboard = () => {
    const { user } = useAuth();

    return (
        <div>
            <h1>Dashboard</h1>
            {user && <p>Welcome, {user.coor_fname} {user.coor_lname}!</p>}
            {/* Add more dashboard content here */}
        </div>
    );
};

export default Dashboard;
